// Edit and save to update!

 //////////



 // Define the data for a "U" shape using a quadratic curve
const myUShapeData = {
    // The paths property defines the outer boundary of the shape.
    paths: [
        'm', -10, 10,     // Start at (-10, 10)
        'l', -10, -5,     // Draw a line down to (-10, -5)
        // Draw a quadratic curve with control point at (0, -10) to endpoint (10, -5)
        'q', 0, -10, 10, -5,
        'l', 10, 10,      // Draw a line up to (10, 10)
        'l', 8, 10,       // Draw a line to (8, 10)
        'l', 8, -5,       // Draw a line down to (8, -5)
        // Draw a quadratic curve to complete the inner curve
        'q', 0, -8, -8, -5,
        'l', -8, 10,      // Draw a line up to (-8, 10)
        'l', -10, 10,     // Close the path back to the start
    ],
    // No holes in this shape, so the holes array is empty.
    holes: [],
    // Set the fn for the shape
    fn: 100
};

// Recreate the shape using the deserializePath function.
const myUShape = shape(myUShapeData);

// Extrude the "U" shape along the Z-axis, with the path using a different fn.
return line3d(myUShape, [0, 0, 0], [0, 0, 50]);





 ////////////

 ////////////////



 // The data for the star's outer shape remains the same.
const myStarShapeData = {
	paths: [
		'm', 0, 10,
		'l', 2.5, 2.5,
		'l', 10, 2.5,
		'l', 5, -2.5,
		'l', 7.5, -10,
		'l', 0, -5,
		'l', -7.5, -10,
		'l', -5, -2.5,
		'l', -10, 2.5,
		'l', -2.5, 2.5,
		'l', 0, 10
	],
	// Add the 'holes' property to the object.
	holes: [
		// A circular hole with a radius of 2, centered at (0, 0).
		// The 'a' command specifies a center point, a radius,
		// a start and end angle, and a clockwise flag.
		['a', 0, 0, 2, 0, Math.PI * 2, true]
	]
};

// Recreate the shape using the deserializePath function.
const myStarShapeWithHole = shape(myStarShapeData);

// Extrude the star with the hole along the Z-axis.
return line3d(myStarShapeWithHole, [0, 0, 0], [0, 0, 20]);

 //////////////

/*
return floor(
	difference(
		color(0x0000ffff,sphere({ r: 20, fn:100 })),
		translate([15, 0, 0], cube([20, 20, 20])),
		translate([0, 0, 15], cylinder({ r: 20, h: 30 , fn:100}))
	)
);
*/
//return cube([40, 50, 60]);


var b1= floor(
	translate([30,0,0],
		cube([5,5,5])
	)
);

var b2= floor(
	translate([0,0,0],
		cube([10,10,10])
	)
);

return {
	b1:b1,
	b2:b2,
};
//*/

return floor(
	translate([30,0,0],
		union(

			translate([5,5,0],
				color(0xffff0000, cube([10,10,10]))
			),
			translate([0,0,0],
				cube([10,10,10])
			)
		)
	)
);

